import "../styles/MailModal.css"; 

function MailModal({ mail, toggleMaileModal }) {
  return (
      <div className="mail-modal">
        <div className="mail-modal-content">
          <p>Téléphone : {mail}</p>
          <button onClick={toggleMaileModal}>Fermer</button>
        </div>
    </div>
  );
}
    
export default MailModal;
